import './App.css';
import Logo from "./assets/src/logo.jpg"
function App() {
  return (
    <>

    <img src={require("./assets/src/logo.jpg")} alt="Logo"></img>
    <img src={Logo} alt="Logo"></img>
    </>



  );
}

export default App;
